        \                           \r\n<p><a href=\"disworkerreport.shtml\">Employers
        - Report a Dislocation Event</a></p>\r\n<p><strong>Update on the Economic
        Stabilization Act:</strong> </p>\r\n<p>\r\nDuring the 2020 legislative session,
        <a href=\"http://mgaleg.maryland.gov/mgawebsite/Legislation/Details/sb0780\">Senate
        Bill 780</a> passed into law and amended the Maryland Economic Stabilization
        Act under Article II, Section 17(c) of the Maryland Constitution - Chapter
        407. The Department of Labor is actively working to develop regulations that
        facilitate the implementation of this new Act and expects that the regulations
        will be out for public comment in November 2020, with full implementation
        occuring by April 1, 2021. Until such time that regulations are available,
        the Department will not enforce full implementation of the Act. Should you
        have an interest in this topic, we encourage you to check the <a href=\"http://www.dsd.state.md.us/MDR/mdregister.html\">Maryland
        Register Online</a> or contact our Department\u2019s Dislocation Services
        Unit at <a href=\"mailto:sheila.bouloubassis@maryland.gov\">sheila.bouloubassis@maryland.gov</a>.</p>\r\n\r\n\uFEFF<!--begin
